tables.table_schema:
CREATE TABLE DebtAccounts (
  account_id INT PRIMARY KEY,
  account_name VARCHAR(255),
  debt_amount DECIMAL(10,2),
  risk_level VARCHAR(50)
);

CREATE TABLE debt_analysis (
  debt_id SERIAL PRIMARY KEY,
  account_id INT NOT NULL,
  debt_amount DECIMAL NOT NULL,
  debt_status VARCHAR(50) NOT NULL
);

CREATE TABLE high_risk_accounts (
  account_id SERIAL PRIMARY KEY,
  account_name VARCHAR(100) NOT NULL,
  account_type VARCHAR(50) NOT NULL,
  risk_score INT NOT NULL
);

CREATE TABLE collection_strategies (
  strategy_id SERIAL PRIMARY KEY,
  strategy_name VARCHAR(100) NOT NULL,
  effectiveness_score INT NOT NULL,
  implementation_date DATE NOT NULL
);

CREATE TABLE debt_forecast (
  forecast_id SERIAL PRIMARY KEY,
  timestamp TIMESTAMP NOT NULL,
  forecast_amount DECIMAL NOT NULL,
  confidence_level INT NOT NULL
);

CREATE TABLE team_members (
  member_id SERIAL PRIMARY KEY,
  member_name VARCHAR(100) NOT NULL,
  role VARCHAR(50) NOT NULL,
  team_id INT NOT NULL
);
